fields.formula:
concat( 
  if( 
    length(join(field("Company"), "")) < 1, 
    "INV", 
    upper( 
      left( 
        regex_replace( 
          join(field("Company"), ""), 
          "(/|'|-|:|\s|\t)", 
          "" 
        ), 
        5 
      ) 
    ) 
  ), 
  year(field("Investment date")), 
  "(", 
  if( 
    row_id() < 10, 
    concat("00", row_id()), 
    if( 
      row_id() < 100, 
      concat("0", row_id()),  
      row_id() 
    ) 
  ), 
  ")" 
)

sum( 
  filter( 
    lookup("Funds ID", "Committed amount"), 
    lookup("Funds ID", "Is collected") 
  ) 
)

if( 
  and( 
    not( 
      isblank(field("Committed capital")) 
    ), 
    field("Committed capital") > 0 
  ), 
  divide( 
    multiply( 
      field("Invested capital"), 
      100 
    ), 
    field("Committed capital") 
  ), 
  0 
)

count( 
  filter( 
    lookup("Funds ID", "Partner role"), 
    contains(totext(lookup("Funds ID", "Partner role")), "GP") 
  ) 
)

concat( 
  "F", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

if( 
  isblank(field("Partner role")), 
  "", 
  if( 
    contains(totext(field("Partner role")), "GP"), 
    "N/A", 
    if( 
      sum(lookup("Invested in", "Number of partners")) > 0, 
      round( 
        multiply( 
          field("Committed amount"), 
          divide( 
            sum(lookup("Invested in", "Annual management rate (%)")), 
            100
          ) 
        ), 
        2 
      ), 
      0 
    ) 
  ) 
)

if( 
  or( 
    isblank(field("Invested in")), 
    isblank(field("Partner role")) 
  ), 
  0, 
  round( 
    if( 
      contains(totext(field("Partner role")), "GP"), 
      add( 
        divide( 
          lookup("Invested in", "Carried interest rate (%)"), 
          lookup("Invested in", "Number of GPs") 
        ), 
        divide( 
          minus( 
            100, 
            lookup("Invested in", "Carried interest rate (%)") 
          ), 
          lookup("Invested in", "Number of partners") 
        ) 
      ), 
      if( 
        lookup("Invested in", "Number of GPs") > 0, 
        divide( 
          minus( 
            100, 
            lookup("Invested in", "Carried interest rate (%)") 
          ), 
          lookup("Invested in", "Number of partners") 
        ), 
        divide(  
          100, 
          lookup("Invested in", "Number of partners") 
        )
      ) 
    ), 
    2 
  ) 
)
